parseFields.code:
function parseFields(payload) {
    const keys = Object.keys(payload);
    const standardProps = ["id","item_key","name","description","ip","form_id","post_id","user_id","parent_item_id","is_draft","updated_by","created_at","updated_at"] 
    const fieldKeys = keys.filter(key => !standardProps.includes(key))

    payload.fields = {}

    fieldKeys.forEach((key) => {
        payload.fields[key] = payload[key]
    });

    payload.created_at = iml.parseDate(payload.created_at);
    payload.updated_at = iml.parseDate(payload.updated_at);

    return payload;
}
